import "./authpages.css"
import logo from "./img/logo.png"

export function AuthPages ({children}) {
return (
    <div className="login">
       <div className="login-logo">
          <img
             src="https://http2.mlstatic.com/D_NQ_NP_815956-MLB50267544590_062022-O.webp"
             alt="MdLockLogin App"
          />
       </div>
       {children}
    </div>
  )  
}
